wminc-code-retired:
Message shown for Incubator projects in languages that are have been retired from ISO 639-3.

See also {{msg-mw|Wminc-code-macrolanguage}} and {{msg-mw|Wminc-code-collective}}

Technical note: This message is not used in extension code, but is used by central templates on-wiki on the Wikimedia Incubator.

wminc-infopage-language-iso1:
Text linking to an ISO 639-1 code.

Parameters:
* $1 - a language code or {{msg-mw|wminc-infopage-language-nocode}}

wminc-infopage-language-directionality:
Which direction a language is written in.

Parameters:
* $1 - {{msg-mw|wminc-infopage-language-directionality-ltr}} or {{msg-mw|wminc-infopage-language-directionality-rtl}}
